import {
    format,
    Logger,
} from 'one-logger';

export class BrowserLogger implements Logger {
    debug(
        title: string,
        description: string,
        context?: any,
    ): void {
        console.debug(
            format('DEBUG', title, description, context)
        );
    }

    error(
        title: string,
        description: string,
        context?: any,
    ): void {
        console.error(
            format('ERROR', title, description, context)
        );
    }

    warn(
        title: string,
        description: string,
        context?: any,
    ): void {
        console.warn(
            format('WARN', title, description, context)
        );
    }

    info(
        title: string,
        description: string,
        context?: any,
    ): void {
        console.info(
            format('INFO', title, description, context)
        );
    }
}
